import React, { useCallback } from "react";
import BtnGroup from "./../services/"

interface StartMenueProps {
  navigateTo: (url: string) => void;
}

const StartMenue: React.FC<StartMenueProps> = ({ navigateTo }) => {
  const handleNavigation = (url: string) => {
    navigateTo(url);
  };

  const buttons = [
    { label: "Vereine", onClick: () => handleNavigation("/vereine") },
    { label: "Mitglieder", onClick: () => handleNavigation("/mitglieder") },
    { label: "Vereine", onClick: () => handleNavigation("/vereine") },
    { label: "Vereine", onClick: () => handleNavigation("/vereine") },
    { label: "Vereine", onClick: () => handleNavigation("/vereine") },
    { label: "Vereine", onClick: () => handleNavigation("/vereine") },
    { label: "Vereine", onClick: () => handleNavigation("/vereine") },
    { label: "Vereine", onClick: () => handleNavigation("/vereine") },
    { label: "Vereine", onClick: () => handleNavigation("/vereine") },
  ];



  return (
    <div className="start-menue">
      {/* ... Other content ... */}
      <BtnGroup buttons={buttons} />
    </div>
  );
};

export default StartMenue;
